import { createStore } from "redux";
import reducer from "./reducers";
import initial from "./initial";

const store = createStore(reducer, initial, window.__REDUX_DEVTOOLS_EXTENSION__
&& window.__REDUX_DEVTOOLS_EXTENSION__(),);
